class EthernetPortPainter extends CustomPainter {
  final Color color;
  final double strokeWidthPx;
  const EthernetPortPainter({
    this.color = Colors.black,
    this.strokeWidthPx = 1.0,
  });
  @override
  void paint(Canvas canvas, Size size) {
    final path = buildEthernetPortPath();
    final b = path.getBounds();
    final scale = math.min(size.width / b.width, size.height / b.height);
    final dx = (size.width - b.width * scale) / 2 - b.left * scale;
    final dy = (size.height - b.height * scale) / 2 - b.top * scale;
    canvas.translate(dx, dy);
    canvas.scale(scale, scale);
    final paint = Paint()
      ..color = color
      ..style = PaintingStyle.stroke
      ..strokeWidth = strokeWidthPx / scale
      ..strokeJoin = StrokeJoin.round
      ..strokeCap = StrokeCap.round;
    canvas.drawPath(path, paint);
  }

  @override
  bool shouldRepaint(covariant EthernetPortPainter oldDelegate) => false;
}

